import React, { useState, useEffect } from 'react';
import { X, Sparkles, Plus } from 'lucide-react';
import { generateAIQuestion } from '../services/aiService';

export default function AIQuestionModal({ isOpen, onClose, testType, topic, totalQuestions, onAddQuestions }) {
  const [questions, setQuestions] = useState([]);
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    if (isOpen) fetchAIQuestions();
  }, [isOpen, testType, topic, totalQuestions]);

  const fetchAIQuestions = async () => {
    setIsLoading(true);
    try {
      const { questions: generated } = await generateAIQuestion({ testType, topic, totalQuestions });
      // Ensure each question has safe default values
      const sanitized = (generated || []).map(q => {
        if (testType === 'MCQ') {
          return {
            question: q.question || '',
            options: Array.isArray(q.options) && q.options.length === 4 ? q.options : ['', '', '', ''],
            correctOption: q.correctOption || 'A',
            marks: q.marks || 1,
          };
        } else if (testType === 'Long') {
          return {
            question: q.question || '',
            marks: q.marks || 5,
            options: [],
          };
        } else if (testType === 'Coding') {
          return {
            question: q.question || '',
            expectedOutput: q.expectedOutput || 'Output TBD',
            marks: q.marks || 5,
            options: [],
          };
        }
        return q;
      });

      setQuestions(sanitized);
    } catch (error) {
      console.error('Failed to generate AI questions:', error);
      setQuestions([]);
    } finally {
      setIsLoading(false);
    }
  };

  const handleAddQuestions = () => {
    onAddQuestions(questions);
    onClose();
  };

  if (!isOpen) return null;

  return (
    <div className="fixed inset-0 bg-black/50 backdrop-blur-sm flex items-center justify-center z-50 p-4">
      <div className="bg-white rounded-xl shadow-2xl max-w-3xl w-full max-h-[90vh] overflow-y-auto">
        <div className="flex items-center justify-between p-6 border-b border-gray-200">
          <div className="flex items-center space-x-3">
            <div className="w-8 h-8 bg-purple-100 rounded-lg flex items-center justify-center">
              <Sparkles className="h-5 w-5 text-purple-600" />
            </div>
            <h2 className="text-xl font-semibold text-gray-900">AI Generated Questions</h2>
          </div>
          <button
            onClick={onClose}
            className="p-2 text-gray-400 hover:text-gray-600 transition-colors duration-200"
          >
            <X className="h-5 w-5" />
          </button>
        </div>

        <div className="p-6 space-y-6">
          {isLoading ? (
            <div className="flex items-center justify-center py-12">
              <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-purple-600"></div>
              <span className="ml-3 text-gray-600">Generating questions...</span>
            </div>
          ) : (
            <>
              {questions.length > 0 ? (
                questions.map((q, idx) => (
                  <div key={idx} className="p-4 border border-gray-200 rounded-lg space-y-2">
                    <p><b>Q{idx + 1}:</b> {q.question}</p>

                    {Array.isArray(q.options) && q.options.length > 0 && (
                      <ul className="list-disc list-inside ml-4">
                        {q.options.map((opt, i) => (
                          <li key={i}>{opt}</li>
                        ))}
                      </ul>
                    )}

                    {q.expectedOutput && (
                      <p><b>Expected Output:</b> {q.expectedOutput}</p>
                    )}

                    <p><b>Marks:</b> {q.marks}</p>
                  </div>
                ))
              ) : (
                <p className="text-gray-500">No questions generated yet.</p>
              )}

              <div className="flex space-x-4 pt-4">
                <button
                  onClick={handleAddQuestions}
                  className="flex-1 px-6 py-3 bg-purple-600 text-white rounded-lg hover:bg-purple-700 transition-all duration-200 flex items-center justify-center space-x-2 font-medium"
                >
                  <Plus className="h-4 w-4" />
                  <span>Add All Questions</span>
                </button>
                <button
                  onClick={fetchAIQuestions}
                  className="px-6 py-3 border-2 border-purple-600 text-purple-600 rounded-lg hover:bg-purple-50 transition-all duration-200 flex items-center space-x-2 font-medium"
                >
                  <Sparkles className="h-4 w-4" />
                  <span>Regenerate</span>
                </button>
              </div>
            </>
          )}
        </div>
      </div>
    </div>
  );
}
